import React, { Fragment } from "react";
import { Route } from "react-router";
import Products from "./components/Products";
import Footer from "./components/Footer"
import Nav from "./components/Nav"



function App() {


  return (
    <Fragment>
      <header> <Nav /></header>
          {/* {/* <Route path="/"/> */}
          <Route path="/products/"/>
          <Route path="/product/:productId"/>
      <Products />
      <footer>
        <Footer />
        </footer>
    </Fragment>
  );
}

export default App;
